        <script>
            $(document).ready(function() {

                moment.lang('en', {
                    week: {
                        dow: start_week
                    }
                });
                $('#enquiry_date').daterangepicker({

                    locale: {
                        format: calendar_date_time_format
                    }
                });
            });

            function getRecord(id, status) {
                $.ajax({
                    url: 'https://easywayglobal.in/admin/enquiry/details/' + id + '/' + status,
                    success: function(result) {
                        $('#getdetails').html(result);
                    }
                });
            }

            function postRecord(id) {
                $.ajax({
                    url: 'https://easywayglobal.in/admin/enquiry/editpost/' + id,
                    type: 'POST',
                    data: $("#myForm1").serialize(),
                    dataType: 'json',
                    success: function(data) {
                        if (data.status == "fail") {
                            var message = "";
                            $.each(data.error, function(index, value) {
                                message += value;
                            });
                            errorMsg(message);
                        } else {
                            successMsg(data.message);
                            window.location.reload(true);
                        }
                    },
                    error: function() {
                        alert("Fail")
                    }
                });
            }

            function saveEnquiry() {
                $.ajax({
                    url: 'https://easywayglobal.in/admin/enquiry/add',
                    type: 'POST',
                    dataType: 'json',
                    data: $("#formadd").serialize(),
                    success: function(data) {
                        if (data.status == "fail") {
                            var message = "";
                            $.each(data.error, function(index, value) {
                                message += value;
                            });
                            errorMsg(message);
                        } else {
                            successMsg(data.message);
                            window.location.reload(true);
                        }
                    },
                    error: function() {
                        alert("Fail")
                    }
                });
            }

            function delete_enquiry(id) {
                if (confirm('Delete Confirm?')) {
                    $.ajax({
                        url: 'https://easywayglobal.in/admin/enquiry/delete/' + id,
                        type: 'POST',
                        dataType: 'json',
                        success: function(data) {
                            if (data.status == "fail") {
                                var message = "";
                                $.each(data.error, function(index, value) {
                                    message += value;
                                });
                                errorMsg(message);
                            } else {
                                successMsg(data.message);
                                window.location.reload(true);
                            }
                        }
                    })
                }
            }

            function follow_up(id, status) {
                $.ajax({
                    url: 'https://easywayglobal.in/admin/enquiry/follow_up/' + id + '/' + status,
                    success: function(data) {
                        $('#getdetails_follow_up').html(data);
                        $.ajax({
                            url: 'https://easywayglobal.in/admin/enquiry/follow_up_list/' + id,
                            success: function(data) {
                                $('#timeline').html(data);
                            },
                            error: function() {
                                alert("Fail")
                            }
                        });
                    },
                    error: function() {
                        alert("Fail")
                    }
                });
            }

            function update() {
                window.location.reload(true);
            }
        </script>
